import React, { Component } from "react";
import "./Form.scss";
import M from "materialize-css";
import axios from "axios";
import FormData from "form-data";
//import ImageUploader from 'react-images-upload';
export default class Form extends Component {
  componentDidMount() {
    document.addEventListener("DOMContentLoaded", function () {
      var elems = document.querySelectorAll("select");
      var options = {};
      var instances = M.FormSelect.init(elems, options);
    });
  }

  constructor(props) {
    super(props);

    this.state = {
      companyname: "",
      companyaddress: "",
      email: "",
      mobileno: "",
      Description: "",
      companycountry: "",
      companystate: "",
      companytype: "",
      propertyname: "",
      state: "",
      pincode: "",
      country: "",
      phonenumber1: "",
      phonenumber2: "",
      emailid: "",
      propertyaddress: "",
      noofFloors: "",
      noofRooms: "",
      twosharing: "",
      threesharing: "",
      foursharing: "",
      onesharingvacant: "",
      twosharingvacant: "",
      threesharingvacant: "",
      foursharingvacant: "",
      fivesharingvacant: "",
      propertylandmark: "",

      ac: "",
      wifi: "",
      washingmachine: "",
      fridge: "",
      tv: "",
      elevator: "",
      kitchen: "",
      geyser: "",
      powerbackup: "",
      parking: "",
      heater: "",
      camera: "",
      payment: "",
      table: "",
      chair: "",
      cot: "",
      mattress: "",
      pillow: "",
      cupboard: "",
      selectedFile: "",
      food: "",
      transportation: "",
      sanitization: "",
      roomcleaning: "",
    };
    this.changehandler = this.changehandler.bind(this);
    this.submithandler = this.submithandler.bind(this);
    this.handleAmentiesChange = this.handleAmentiesChange.bind(this);
    this.handleServicesChange = this.handleServicesChange.bind(this);
    this.changedropdown = this.changedropdown.bind(this);
    // this.changehandler=this.changehandler.bind(this);
  }

  onFileChangeHandler = (e) => {
    e.preventDefault();
    this.setState({
      selectedFile: e.target.files[0],
    });
    const formData = new FormData();
    formData.append("file", this.state.selectedFile);
    //Append the rest data then send
    axios({
      method: "post",
      url: "http://localhost:3001/postImage",
      data: formData,
      headers: { "Content-Type": "multipart/form-data" },
    }).then(
      function (response) {
        console.log(response);
      },
      function (error) {
        console.log("Error");
      }
    );
  };
  changedropdown = (event) => {
    this.setState({ [event.target.name]: event.target.value });
  };
  changehandler = (e) => {
    //we can extract event values
    //saving into state property
    this.setState({
      [e.target.name]: e.target.value,
    });
    {
      console.log(this.state);
    }
  };
  handleAmentiesChange = (e) => {
    //  const amenties = e.target.checked;
    //  this.setState({ amenties });
    const value =
      e.target.type === "checkbox" ? e.target.checked : e.target.value;
    const name = e.target.name;

    this.setState({
      [name]: value,
    });
  };
  handleServicesChange = (e) => {
    const value =
      e.target.type === "checkbox" ? e.target.checked : e.target.value;
    const name = e.target.name;

    this.setState({
      [name]: value,
    });
  };

  submithandler = (e) => {
    e.preventDefault();
    var companydetails = {
      companyName: this.state.companyname,
      address: this.state.companyaddress,
      email: this.state.email,
      mobileNumber: this.state.mobileno,
      description: this.state.companydesc,
      country: this.state.country,
      state: this.state.companystate,
      companyType: this.state.companytype,

      property: {
        propertyName: this.state.propertyname,
        propertyType: this.state.propertytype,
        profileDesc: this.state.profiledesc,
        propertyAddress: {
          propertyNumber: "",
          street: "",
          location: "",
          address: this.state.propertyaddress,
          city_code: "",
          city_Description: "",
          state: this.state.propertystate,
          pincode: this.state.pincode,
          state_code: "",
          country: this.state.country,
          phone_Number_First: this.state.phonenumber1,
          phone_Number_Second: this.state.phonenumber2,
          email: this.state.emailid,
          website: "",
          street_Code: "",
        },
        propertyDescription: {
          noOfFloor: this.state.noofFloors,
          noOfRoomsAvailable: this.state.noofRooms,
          oneSharing: this.state.oneSharing,
          twoSharing: this.state.twosharing,
          threeSharing: this.state.threesharing,
          fourSharing: "",
          fiveSharing: "",
          sixSharing: "",
          oneSharingVacant: this.state.onesharingvacant,
          twoSharingVacant: this.state.twosharingvacant,
          threeSharingVacant: this.state.threesharingvacant,
          fourSharingVacant: this.state.foursharingvacant,
          fiveSharingVacant: this.state.fivesharingvacant,
          sixSharingVacant: "",
          oneSharingRent: "",
          doubleSharingRent: "",
          tripleSharingRent: "",
        },
        PropertyImage: {
          propertyImageOne: this.state.selectedFile,
          propertyImageTwo: "",
          propertyImageThree: "",
          propertyImageFour: "",
          propertyImageFive: "",
          propertyImageSix: " ",
          propertyImageSeven: "",
          propertyImageEight: "",
          propertyImageNine: "",
          propertyImageTen: "",
          propertyImageEleven: "",
          propertyImageTwelve: "",
        },
        PropertyLandmarks: {
          Hospital: "",
          School: "",
          itPark: "",
          superMarket: "",
          railwayStation: "",
          busStop: "",
          eduInstitute: "",
          college: "",
          medicalStore: "",
          airport: "",
          heartofTheCity: "",
          autoStand: "",
          vegetableShop: "",
        },

        amenities: {
          ac: this.state.ac,
          wifi: this.state.wifi,
          washingmachine: this.state.washingmachine,
          freeze: this.state.fridge,
          tv: this.state.tv,
          Elevator: this.state.elevator,
          Kitchen: this.state.kitchen,
          Geyser: this.state.geyser,
          Powerbackup: this.state.powerbackup,
          ParkingFacility: this.state.parking,
          RoomHeater: this.state.heater,
          CCTVCameras: this.state.camera,
          CardPayments: this.state.payment,
          Table: this.state.table,
          Chair: this.state.sofa,
          Cot: this.state.cot,
          Mattress: this.state.mattress,
          Pillow: this.state.pillow,
          Cupboard: this.state.cupboard,
        },
        services: {
          Food: this.state.food,
          Roomcleaning: this.state.roomcleaning,
          Transportation: this.state.transportation,
          Sanitization: this.state.sanitization,
        },
      },
    };

    console.log("companydetails:", companydetails);

    axios
      .post(`http://localhost:8080/api/dtoty`, companydetails)
      .then((res) => {
        console.log("posted!", res);
      });
  };

  render() {
    // const {companyname ,companyaddress ,companystate,email,mobileno,desc,ac,wifi ,scc,optio}=this.state
    return (
      <div className="container">
        {console.log(this.state)}
        <form onSubmit={this.submithandler}>
          {/* Row Started */}
          <div className="row">
            <h3 className="center">PG Details Form</h3>
            <div className="col s5">
              <label>
                Company Name/Owner Name
                <input
                  type="text"
                  style={{
                    border: "solid",
                    borderStyle: "groove",
                    color: "grey",
                  }}
                  name="companyname"
                  onChange={this.changehandler}
                />
              </label>
            </div>
            <div className="col s5">
              <label>
                Company Address
                <input
                  type="text"
                  style={{
                    border: "solid",
                    borderStyle: "groove",
                    color: "grey",
                  }}
                  name="companyaddress"
                  onChange={this.changehandler}
                />
              </label>
            </div>
          </div>
          {/* Row ended */}
          <div className="row">
            <div className="col s5">
              <label>
                Email
                <input
                  type="email"
                  style={{
                    border: "solid",
                    borderStyle: "groove",
                    color: "grey",
                  }}
                  name="email"
                  onChange={this.changehandler}
                />
              </label>
            </div>
            <div className="col s5">
              <label>
                Mobile No.
                <input
                  type="text"
                  style={{
                    border: "solid",
                    borderStyle: "groove",
                    color: "grey",
                  }}
                  name="mobileno"
                  onChange={this.changehandler}
                />
              </label>
            </div>
          </div>
          {/* Row ended */}
          <div className="row">
            <div className="col s5">
              <label>
                Description
                <input
                  type="text"
                  style={{
                    border: "solid",
                    borderStyle: "groove",
                    color: "grey",
                  }}
                  name="companydesc"
                  onChange={this.changehandler}
                />
              </label>
            </div>
            <div className="col s5">
              <label>
                Country
                <input
                  type="text"
                  style={{
                    border: "solid",
                    borderStyle: "groove",
